import React from "react";

import logo from "../images/fox.jpg";

const SettingStore = () => {
  return (
    <div className="setting-store">
      <h1 className="title-dashboard">إعداد المتجر</h1>
      <div>
        <img src={logo} alt="logo" />
      </div>
    </div>
  );
};

export default SettingStore;
